import React from "react";

function Skill(props) {
    const skill = props.data;

    return(
        <div className="skill-container">
            <h1>{skill.title}</h1>
            <img src={skill.img} alt="Loading.." className="skill-img" width="200" height="200"></img>
        </div>
    )
}

export default Skill;
